import Navbar from "../components/Navbar";

export default function Home() {
  return (
    <div className="bg-giGreen min-h-screen text-white">
      <Navbar />

      <main className="pt-20 px-6 pb-10">
        <section className="max-w-5xl mx-auto text-center">
          <h1 className="text-4xl font-bold mb-4">
            Selamat Datang di GiMultiLab
          </h1>
          <p className="text-lg">
            Bangun kemandirian pangan dengan teknologi & informasi gizi yang tepat.
          </p>
        </section>
      </main>
    </div>
  );
}
